import React from 'react';
import { Navbars } from './navs';
import { Content } from '../components/Dashboard-main/dash-content';
import {GlobalProvider} from '../Context/GlobalState';

export const Dashboard=()=>{
    return(
        <GlobalProvider>
            <Navbars/>
            <Content/>
        </GlobalProvider>
    )
}
